    [],nt"num_tags": 7,nt"name": "narrative-report-crescent-lake-refuge-january-february-march-april-1947",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from January through April
    of 1947. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. Resource management is outlined; topics include grazing,
    haying, and fur harvesting. The public relations section of the report describes
    recreational uses, Refuge visitors, and Refuge participation. A short narrative
    report of North Platte National Wildlife Refuge is attached, as well as some N-R
    forms.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
